    SANCHP_ACT.processOffer=function(each_offer,offer_iden){
		var offer_toshow=false;
		if(each_offer && each_offer.status && each_offer.status =='Pass'){ 
			
			if(each_offer.term !="" && each_offer.term != "0"){
				QNIAPP.IN.Qt.qtdtls['term']=each_offer.term;
				QNIAPP.IN.Qt['term']=each_offer.term;
				QNIAPP.IN.Qt.qtdtls['sumAssured']=QNIAPP.IN.Qt.qtdtls['sumAssured'];
				QNIAPP.IN.Qt['sumassured']=QNIAPP.IN.Qt.qtdtls['sumAssured'];
			}
			if(each_offer.ppt != "" && each_offer.ppt != "0"){
				QNIAPP.IN.Qt.qtdtls['ppt']=each_offer.ppt; // term and ppt will be same values
			QNIAPP.IN.Qt.qtdtls['sumAssured']='0';
			QNIAPP.IN.Qt['sumassured']='0';
			}
			
			
			// Changes for upsell for the riders -- 
			if(each_offer.riders && each_offer.riders.length>0){
				for(var i=0;i<each_offer.riders.length;i++){
					
				QNIAPP.IN.Qt.qtdtls['rider']={};
				QNIAPP.IN.Qt.qtdtls['rider']=each_offer.riders;
				QNIAPP.IN.Qt.qtdtls['rider'][i]['name'] =  each_offer.riders[i].name ? each_offer.riders[i].name.toString() :'';   // WODM sends the name as Array. So,converting to string -- 
				QNIAPP.IN.Qt.qtdtls['rider'][i]['sumAssured'] = each_offer.riders[i]['sumassured'];
				//QNIAPP.IN.Qt.qtdtls['rider'][i]['sumAssured'] = each_offer.riders[i].sumassured;
				QNIAPP.IN.Qt.qtdtls['rider'][i]['term'] = QNIAPP.IN.Qt.qtdtls.ppt;
				QNIAPP.IN.Qt.qtdtls['rider'][i]['ppt'] =  QNIAPP.IN.Qt.qtdtls.ppt;
				QNIAPP.IN.Qt.qtdtls['rider'][i]['pptopt'] = each_offer.riders[i]['pptopt'];
				QNIAPP.IN.Qt.qtdtls['rider'][i]['deleteflg'] = 'N';
			}
			}
			//Changes end here -- 
			
			offer_toshow = validateUpsellOffer(offer_iden);
		}
		return offer_toshow;
	};
	
