		  SANCHP.calcLumpsumAmt = function(payout,annual_premium,adjusPrem){
              var outstndngMonths = 0;
              var ropp= 0;
              var ropp_fact = 0;
              if(QNIAPP.IN.Qt.qtdtls.plan=='Guaranteed Income'){
				outstndngMonths =QNIAPP.IN.Qt.qtdtls.income_term*12;
              }
              else if(QNIAPP.IN.Qt.qtdtls.plan=='Life Long Income'){
			    outstndngMonths = (99-(parseInt(QNIAPP.IN.Qt.qtdtls.term) + parseInt(QNIAPP.IN.Qt.qtdtls.age))) * 12;
              }
              else if(QNIAPP.IN.Qt.qtdtls.plan=='Long Term Income'){
            	//outstndngMonths = (QNIAPP.IN.Qt.qtdtls.term==eval('QNIAPP.'+QNIAPP.PRODUCT_DETAILS.get(QNIAPP.IN['id'],'term')+'.getPT();')[0] || QNIAPP.IN.Qt.qtdtls.term==eval('QNIAPP.'+QNIAPP.PRODUCT_DETAILS.get(QNIAPP.IN['id'],'term')+'.getPT();')[1]) ?  30*12 : 25*12;
            	outstndngMonths = QNIAPP.IN.Qt.qtdtls.income_term*12;
              }
              var int_rate = 7.50; //GSEC10 and GSEC40 --GSEC10(GI) and GSEC40(LTI and LLI)
             // var int_rate = (QNIAPP.IN.Qt.qtdtls.plan=='Guaranteed Income')?9.20:9.30;
		      var mod = outstndngMonths - Math.floor(outstndngMonths/(12/FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].f)) * (12/FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].f);
			  var int_rate_ann = (((Math.floor(((int_rate/100) + 0.015 + 0.0024)*4*100)/100)/4));
			  var int_rate_month = Math.pow(parseFloat((1+int_rate_ann).toFixed(9)),parseFloat((1/12).toFixed(5)))-1;
			  var month_disc_rate = Math.pow(parseFloat((1/1.09)),parseFloat((1/12)).toFixed(9));
			  var next_pay = parseFloat(Math.pow((month_disc_rate),(mod == 0?12/(FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].f):mod)).toFixed(9));
              var freq_intrate = parseFloat((Math.pow((1+int_rate_ann),parseFloat((1/FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].f).toFixed(5)))-1).toFixed(9));
              var freq_disc_rate = parseFloat((1/(1+freq_intrate)).toFixed(9));
              var other_pay_portion =parseFloat((Math.pow(month_disc_rate,(mod == 0?12/FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].f:mod)) * ((1-Math.pow(freq_disc_rate,(((outstndngMonths/12)*FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].f)-1)))/freq_intrate)).toFixed(9));
              var incomeFactor = parseFloat((other_pay_portion + next_pay).toFixed(9));
			  var GuaranteedIncome = Math.round((payout)*(annual_premium)*((FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].pyout)/(FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.pyfrequency].f)));
			  if(QNIAPP.IN.Qt.qtdtls.plan!='Guaranteed Income'){
		      ropp = Math.round(adjusPrem * FREQ_PD_MAP[QNIAPP.IN.Qt.qtdtls.freq].f * QNIAPP.IN.Qt.qtdtls.ppt);
			  ropp_fact = Math.pow((month_disc_rate),(outstndngMonths));
			  }
			  var lumpsum_amt = Math.round((incomeFactor * GuaranteedIncome) + (ropp*ropp_fact));
			  return lumpsum_amt;
			  
		  };
		
		  SANCHP.calcPremium = function()
		  {	
			  var annual_sa = parseFloat((QNIAPP.IN.Qt.qtdtls.sumAssured * PREM_CONV_FC).toFixed(2));
			  var premium = Math.round(annual_sa/PREM_RT) /EMP_DISC;
				return premium;
		  };	  
		  SANCHP.calcSumAssured = function()
		  {		
			  
			  var adjprem=(QNIAPP.IN.Qt.qtdtls.pmaFlag=="Y" && QNIAPP.IN.chnlptnr=="Defence")?Math.round(QNIAPP.IN.Qt.qtdtls.premium/(QNIAPP.COMM_CALC.pmaCalculationDefence("SANCHP"))):QNIAPP.IN.Qt.qtdtls.premium;
				  var annual_premium = parseFloat((adjprem/PREM_CONV_FC).toFixed(2));
				  if(QNIAPP.IN.Qt.qtdtls.pmaFlag=="Y" && QNIAPP.IN.chnlptnr=="Defence"){
						QNIAPP.IN.Qt.qtdtls.adjusPremium=(adjprem);
					}
			  var sum_a = Math.round(annual_premium * PREM_RT) * EMP_DISC;
				return sum_a;
		  };		  
