	SANCHP_val.checkInputs = function(){		
	    var res=-2;
	    var in_arr=['incpDt','gender','freq','term','ppt'/*,'paymethod'*/];
	    var valid_flag=false;
	    var prop="";
		for(var key=0;key<in_arr.length;key++) {
			prop = in_arr[key];
			valid_flag = checkNull(QNIAPP.IN.Qt.qtdtls[prop],QNIAPP.PROP_MAP[prop]);			
			if(prop === 'freq' && valid_flag)  
			{
				res = jQuery.inArray(QNIAPP.IN.Qt.qtdtls.freq, QNIAPP.COMM_PARMS.getFreq());
				if(res === -1)
				{
					QNIAPP.ERR.push(QNIAPP.CONSTS.ERRF);
				}			
			}
			if( prop === 'term' && valid_flag)
			{
				
				res = jQuery.inArray(parseInt(QNIAPP.IN.Qt.qtdtls.term), QNIAPP.SANCHP_TERM.getPT());
				if(res === -1)
				{
					QNIAPP.ERR.push(QNIAPP.CONSTS.ERRT);
					
				}
		    }
			if(prop === 'ppt' && valid_flag)
			{
				res = jQuery.inArray(parseInt(QNIAPP.IN.Qt.qtdtls.ppt), QNIAPP.SANCHP_TERM.getPPT(QNIAPP.IN.Qt.qtdtls.term));
				if(res === -1)
				{
					QNIAPP.ERR.push(QNIAPP.CONSTS.ERRPPT);
					
				}
			}
			if(prop === 'paymethod' && valid_flag)
			{
				var isECS=(QNIAPP.IN.Qt.qtdtls.freq === QNIAPP.CONSTS['Q'] || QNIAPP.IN.Qt.qtdtls.freq === QNIAPP.CONSTS['M'])?true:false;
				res = jQuery.inArray(QNIAPP.IN.Qt.qtdtls.paymethod, QNIAPP.COMM_PARMS.getPayMthd(isECS));
				if(res === -1)
				{
					QNIAPP.ERR.push(QNIAPP.CONSTS.ERRPAY);
				}
			}
		}
		dobCheck(QNIAPP.IN.Qt.qtdtls.dob,false,QNIAPP.IN.Qt.qtdtls.incpDt);
		
		if(( QNIAPP.IN.Qt.qtdtls.premium==='' && QNIAPP.IN.Qt.qtdtls.sumAssured==='')) 
		{
			QNIAPP.ERR.push(QNIAPP.CONSTS.ERRPREMSA);
		}
		
		return (QNIAPP.ERR.length>0)? false: true;
	};
	
	SANCHP_val.checkBusRules = function(){
		var objCheck = QNIAPP.SANCHP_val.checkInputs();
		if(objCheck)
		{
			QNIAPP['ERR']=[];
			checkDateVal(QNIAPP.IN.Qt.qtdtls.incpDt);	
			QNIAPP.IN.Qt.qtdtls.age = typeof(QNIAPP.IN.Qt.qtdtls.age)==='string'?parseInt(QNIAPP.IN.Qt.qtdtls.age):QNIAPP.IN.Qt.qtdtls.age;
			QNIAPP.SANCHP_val.checkAge(QNIAPP.IN.Qt.qtdtls.term,QNIAPP.IN.Qt.qtdtls.age);
			QNIAPP.SANCHP_val.checkRiderSelectedForDefence();
			QNIAPP.SANCHP_val.checkTermPPT();
			if(QNIAPP.IN.Qt.qtdtls.plan ==="Guaranteed Income" || QNIAPP.IN.Qt.qtdtls.plan ==="Long Term Income"){
				QNIAPP.SANCHP_val.checkIncomeTerm();
			}
			if(QNIAPP.IN.Qt.qtdtls.sumAssured && QNIAPP.IN.Qt.qtdtls.sumAssured != '0')
				{
					QNIAPP.SANCHP_val.checkSumAssured(QNIAPP.IN.Qt.qtdtls.sumAssured);
				}
			else{
				if(QNIAPP.IN.Qt.qtdtls.premium && QNIAPP.IN.Qt.qtdtls.premium != '0')
					QNIAPP.SANCHP_val.checkMinPremium(QNIAPP.IN.Qt.qtdtls.premium,'IN');
				else{
					QNIAPP.ERR.push(QNIAPP.CONSTS.ERRPREMSAVALID);
				}
			}
		}
		
		
		return (QNIAPP.ERR.length>0)?false:true;
	};
	
	SANCHP_val.checkComboAvailableForQIT = function(){
		var qitFlag = true;
		var prop_arry=['age','freq','ppt','annualIncm','nri','occutype','proposerBuyingForItself','panno','agentcode'];
		var prop='';
		var annualIncm = QNIAPP.IN.Qt.qtdtls.annualincm;
		var nri = QNIAPP.IN.Qt.qtdtls.nri;
		var freq = QNIAPP.IN.Qt.qtdtls.freq;
		var ppt = QNIAPP.IN.Qt.qtdtls.ppt;
		var occutype = QNIAPP.IN.Qt.qtdtls.occutype;
		var age = QNIAPP.IN.Qt.qtdtls.age;
		var laPPh = QNIAPP.IN.Qt.qtdtls.proposerBuyingForItself;
		var panno = QNIAPP.IN.Qt.qtdtls.panno;
		var agentcode = QNIAPP.IN.Qt.qtdtls.agentcode;
		for(var i=0;i<prop_arry.length;i++){
			prop=prop_arry[i];
			if(prop === 'age')  
			{
				if(!(typeof age != "undefined" && age != null && age != "" && parseInt(age) >= 18 && parseInt(age) <= 50)){
					qitFlag=false;
					break;
				}
				
			}
			if(prop === 'annualIncm')
			{ 
				if (!(typeof annualIncm != "undefined" && annualIncm != null && annualIncm != "" && parseInt(annualIncm) >= 300000)){
					qitFlag=false;
					break;
				}
			}
			if(prop === 'freq')  
			{
				if(!(typeof freq != "undefined" && freq != null && freq != "" && (freq == "Annual" || freq == "Half Yearly" || freq == "Quarterly" || freq == "Monthly"))) {
					qitFlag=false;
					break;
				}
			}
			if(prop === 'ppt')
			{ 
				if(!(typeof ppt != "undefined" && ppt != null && ppt != "" && parseInt(ppt) == 10)){
					qitFlag=false;
					break;
				}
			
			}
			if(prop === 'nri'){
				if (!(typeof nri != "undefined" && nri != null && nri != "" && nri == "0")){
					qitFlag=false;
					break;
				}
			}
			if(prop === 'proposerBuyingForItself'){
				if (!(typeof laPPh != "undefined" && laPPh != null && laPPh != "" && laPPh == "Yes")){
					qitFlag=false;
					break;
				}
			}
			if(prop === 'occutype')
			{ 
				if (!(typeof occutype != "undefined" && occutype != null && occutype != "" && (occutype == "OCCT_SALR" || occutype == "OCCT_SEBS"))){
					qitFlag=false;
					break;
				}
			}
			if(prop === 'panno')
			{ 
				if (!(typeof panno != "undefined" && panno != null && panno != "")){
					qitFlag=false;
					break;
				}
			}
			if(prop === 'agentcode')
			{
				if (!(agentcode!=undefined && agentcode!= null && agentcode!= "" && agentcode=="00000000" )){
					qitFlag=false;
					break;
				}
			}
		}
		return qitFlag;
	};

